// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

//  price   getPrice  
//   _tokenId   
// --    

// openzeppelin ERC721   ERC721URIStorage 
// ERC721 == NFT
contract MyNFT is ERC721URIStorage, Ownable {

    //struct NFT{
    //    string released;
    //    uint tokenId;
    //    string imageName;
    //    address owner;
    //    uint price;
    //    string tokenURI;
    //}

    struct DetailOfNFT{
        uint tokenId;
        address owner;
        string tokenURI;
        string imageName;
        uint price;
        string released;
    }

    struct NFT{
        uint tokenId;
        string imageName;
        uint price;
        string released;
    }

    struct ShortNFT{
        uint tokenId;
        string tokenURI;
    	uint price;
    }

	//      
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    mapping(address => uint[]) HoldersList;
    mapping(uint => NFT) ListOfNft;
    mapping(address => string) AddressToNickname;
    mapping(string => address) NicknameToAddress;

    constructor () ERC721("MyNFT", "NFT") {}

    function mintNFT(string memory _tokenURI, string memory _released, string memory _imageName, uint _price) public returns (uint256) {
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();


        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, _tokenURI);

        HoldersList[msg.sender].push(newItemId);
        ListOfNft[newItemId] = NFT(newItemId, _imageName, _price, _released);
        //ListOfNft[newItemId] = NFT(_released, newItemId, _imageName, msg.sender, _price, _tokenURI);

        return newItemId;
    }

    function getAllNFT() public view returns(ShortNFT[] memory){
        ShortNFT[] memory allNFT = new ShortNFT[](_tokenIds.current());
        for(uint i = 1; i <= _tokenIds.current(); i++){
            allNFT[i - 1] = ShortNFT(i, tokenURI(i), ListOfNft[i].price);
        }
        return allNFT;
    }

    //nft     
    function getListShortNFT(uint _startIdx, uint _endIdx) public view returns(ShortNFT[] memory){
        ShortNFT[] memory result = new ShortNFT[](_endIdx - _startIdx + 1);
        for(uint i = _startIdx; i <= _endIdx; i++){
            result[i - _startIdx] = ShortNFT(i, tokenURI(i), ListOfNft[i].price);
        }
        return result;
    }

    function getListHolder(string memory  _who) view public returns(ShortNFT[] memory){

	address _whoAddress;

	if(isValidAddress(_who)){
		_whoAddress = address(bytes20(bytes(_who)));
	}else{
		_whoAddress = NicknameToAddress[_who];
	} 


	uint lengthHolderList = HoldersList[_whoAddress].length;

	ShortNFT[] memory result = new ShortNFT[](lengthHolderList);
        for(uint i = 0; i < lengthHolderList; i++){
            uint tokenId = HoldersList[_whoAddress][i];
            if(tokenId != 0){
                result[lengthHolderList - 1 - i] = ShortNFT(tokenId, tokenURI(tokenId), ListOfNft[tokenId].price);
            }
        }
        return result;
    }

    function nicknameConverAddress(string memory _who) public view returns(address){
    	if(isValidAddress(_who)){
		return address(bytes20(bytes(_who)));
	}else{
		return NicknameToAddress[_who];
	}
    }

    function isValidAddress(string memory addressString) public pure returns (bool) {
   	 bytes memory addressBytes = bytes(addressString);
    	if (addressBytes.length != 42) {
        	return false; //   42   
    	}
    	bytes20 addressBytes20 = bytes20(addressBytes);
    	if (addressBytes20 == bytes20(0)) {
        	return false; //   Null Address  
    	}
    	return true;
    }

    function getDetailOfNft(uint _tokenId) public view returns(DetailOfNFT memory){
        NFT memory selectedNft = ListOfNft[_tokenId];
        DetailOfNFT memory result = DetailOfNFT(_tokenId, ownerOf(_tokenId), tokenURI(_tokenId), selectedNft.imageName, selectedNft.price, selectedNft.released);
        return result;
    }

    function getNFTId() public view returns(uint256){
        uint result = _tokenIds.current();
        return result;
    }

    function changePrice(uint _tokenId, uint _price) public {
        require(msg.sender == ownerOf(_tokenId), 'sender is not owner');
        ListOfNft[_tokenId].price = _price;
    }

    function buyNFT(uint _tokenId) public payable{
        address seller = ownerOf(_tokenId);
        // 
        require(seller != msg.sender, 'you are holder');
        //   0eth 
        require(ListOfNft[_tokenId].price != 0, 'is not for sale');
       // require(msg.value == ListOfNft[_tokenId].price, 'not right price');

        //
        payable(seller).transfer(msg.value);
        //
        _transfer(seller, msg.sender, _tokenId);
        //ListOfNft[_tokenId].owner = msg.sender;

        for(uint i = 0; i < HoldersList[seller].length; i++){
            if(HoldersList[seller][i] == _tokenId){
                delete HoldersList[seller][i];
                HoldersList[msg.sender].push(_tokenId);
            }
        }
    }

    function getNickName(address _who) public view  returns(string memory){
	string memory _nickname = AddressToNickname[_who];
	return _nickname;
    }
    function setNickName(string memory _nickname) public{
    	AddressToNickname[msg.sender] = _nickname;
	NicknameToAddress[_nickname] = msg.sender;
    }
}
